"""A slight modification had to be made to the environment as it did not contain the 'FlatObsWrapper' we need for our algorithm. Below is the modified code taken from the original minigrid code, modified to work for multi agents. The main changes include accessing each agents observation space seperately to create one flat array of observed images for each agent."""

class FlatObsWrapperMulti(ObservationWrapper):
    """
    Encode mission strings using a one-hot scheme,
    and combine these with observed images into one flat array.
    """

    def __init__(self, env, maxStrLen=96):
        super().__init__(env)

        self.maxStrLen = maxStrLen #used this from the minigrid environment
        self.numCharCodes = 28

        #Must indent into one agents observation space, all agents will be the same since they are in the same env
        imgSpace = env.observation_space[0].spaces["image"]
        imgSize = reduce(operator.mul, imgSpace.shape, 1)

        #loop through all the agents in the env
        for agent in self.env.agents:
          agent.observation_space['image'] = spaces.Box(
              low=0,
              high=255,
              shape=(imgSize + self.numCharCodes * self.maxStrLen,),
              dtype="int64",
          )

        self.cachedStr: str = None



    def observation(self, obs):


        #loop through all the agents
        for agent in env.agents:

            #access one agents obs space at a time
            image = obs[agent.index]["image"] #will this work or i have to do it for all agents since the observations are different
            mission = (obs[agent.index]["mission"]) #encode the mission


            # Cache the last-encoded mission string

            if mission != self.cachedStr:
                assert (
                    len(str(mission)) <= self.maxStrLen
                ), f"mission string too long ({len(str(mission))} chars)"

                strArray = np.zeros(
                    shape=(self.maxStrLen, self.numCharCodes), dtype="float32"
                )

                for idx, ch in enumerate(str(mission)):
                    if ch >= "a" and ch <= "z":
                        chNo = ord(ch) - ord("a")
                    elif ch == " ":
                        chNo = ord("z") - ord("a") + 1
                    elif ch == ",":
                        chNo = ord("z") - ord("a") + 2
                    else:
                        raise ValueError(
                            f"Character {ch} is not available in mission string."
                        )
                    assert chNo < self.numCharCodes, "%s : %d" % (ch, chNo)
                    strArray[idx, chNo] = 1

                self.cachedStr = str(mission)
                self.cachedArray = strArray

            #creates an np.array for each agent.
            obs[agent.index] = np.concatenate((image.flatten(), self.cachedArray.flatten()))

        return obs

"""Our ReplayBuffer class and policy class remained the same with the exception of slight modifications made to accessing the observation and action spaces for the multigrid environment. The methods of learning within the classes remain unchanged."""

class DQNAgent:
    def __init__(
        self,
        observation_space,
        action_space,
        epsilon,
        learning_starts_at,
        learning_frequency,
        learning_rate,
        discount_factor,
        buffer_size,
        target_update_frequency,
        batch_size,
    ):
        self.observation_space = observation_space
        self.action_space = action_space
        self.network = self.build_network(observation_space, action_space)
        self.target_network = copy.deepcopy(self.network).requires_grad_(False) #create independent copies of the network

        self.replay_buffer = ReplayBuffer(
            buffer_size=buffer_size,
            observation_space=observation_space,
            action_space=action_space,
        )
        self.epsilon = epsilon
        self.learning_starts_at = learning_starts_at
        self.learning_frequency = learning_frequency
        self.discount_factor = discount_factor
        self.optimizer = torch.optim.Adam(self.network.parameters(), lr=learning_rate)
        self.loss_fn = torch.nn.MSELoss()
        self.target_update_frequency = target_update_frequency
        self.batch_size = batch_size

    def build_network(self, observation_space, action_space):
        """
        Builds a neural network that maps observations to Q-values for each action.
        ReLu introduced nonlinearities in order to learn complex patterns, dim of 256 is arbitrary and can be adjusted
        Activiation Function: mathematical operation applied to each node in the network to learn complex data and determines the output of a node
        """
        input_dimension = 2835
        output_dimension = action_space.n
        return torch.nn.Sequential(
            torch.nn.Linear(input_dimension, 256),#input layer
            torch.nn.ReLU(),#activation function
            torch.nn.Linear(256, 256),#hidden layer
            torch.nn.ReLU(),#activation function
            torch.nn.Linear(256, output_dimension)) #output layer

    def get_action(self, state):
        """Implements epsilon greedy policy. With probability epsilon, take a random
        action. Otherwise, take the action that has the highest Q-value for the
        current state. For sampling a random action from the action space, take a look
        at the API for spaces: https://gymnasium.farama.org/api/spaces/#the-base-class.
        Do not hardcode the number of actions you are sampling from.

        Parameters:
            - state (np.ndarray): The current state.

        Returns:
            - action (int): The action to take.
        """
        # TO IMPLEMENT
        # samplng method based on gym environment, may be different to mini grid
        state = torch.Tensor(state)
        if np.random.rand() < self.epsilon: #with probability epsilon
          action = self.action_space.sample() #take random sample based on api
        else:
          q_values = self.network(state) #get the q values of the state from the network
          action = torch.argmax(q_values).item() #highest Q value action for current state
        # --------------------------
        return action

    def update(self, experience, step):
        """
        Adds the experience to the replay buffer and performs a training step.

        Parameters:
            - experience (dict): A dictionary containing the keys "observation",
              "action", "reward", "next_observation", "terminated", and "truncated".
        """
        self.replay_buffer.add(
            experience["observation"],
            experience["action"],
            experience["reward"],
            experience["next_observation"],
            experience["terminated"],
        )
        metrics = {}
        if step > self.learning_starts_at and step % self.learning_frequency == 0:
            metrics = self.perform_training_step()


        if step % self.target_update_frequency == 0:
            self.target_network.load_state_dict(self.network.state_dict()) #load model into target network
        return metrics

    def perform_training_step(self):
        (
            observations,
            actions,
            rewards,
            next_observations,
            terminated,
        ) = self.replay_buffer.sample(self.batch_size) #batch_size number of samples from replay buffer
        observations = torch.Tensor(observations) #make observations,actions,rewards,next_observations,terminated into a tensor
        actions = torch.Tensor(actions).long()
        rewards = torch.Tensor(rewards)
        next_observations = torch.Tensor(next_observations)
        terminated = torch.Tensor(terminated)
        q_values = self.network(observations).gather(1, actions.unsqueeze(1)).squeeze() #gather values along axis 1
        with torch.no_grad():
            targets = self.compute_targets(rewards, next_observations, terminated) #see computer target function below for more details
        loss = self.loss_fn(q_values, targets) #torch.MSE_loss as specified in input
        self.optimizer.zero_grad() #perform gradient descent
        loss.backward()
        self.optimizer.step()
        return {
            "loss": loss.item(),
            "q_values": q_values.mean().detach().numpy()
        }

    def compute_targets(self, rewards, next_observations, terminated):
        """
        Computes the target Q-values for a batch of transitions. Make sure to use the
        target network for this computation. If the episode terminated, the target
        Q-value should be the reward, otherwise the reward plus the discounted
        maximum target Q-value for the next state.

        In order to do this efficiently, you should not use a for loop or any if
        statements, but instead use tensor operations and the fact that (1 - terminated)
        will be 0 for all the terminal transitions.

        Parameters:
            - rewards (torch.Tensor): The rewards received for each transition in the
                batch. Shape (batch_size,)
            - next_observations (torch.Tensor): The next observations for each
                transition in the batch. Shape (batch_size, observation_dim)
            - terminated (torch.Tensor): Whether the episode terminated after each
                transition in the batch. Shape (batch_size,)
        Returns:
            - targets (torch.Tensor): The targets for each transition in the batch.
                Shape (batch_size,)
        """
        # TO IMPLEMENT
        # --------------------------
        next_q = self.target_network(next_observations) #next q value based on observation
        max_next_q_values = torch.max(next_q, dim = 1)[0] #find max q from next q values observation
        max_next_q_values *= (1-terminated) #0 for terminated states

        #Q(s,a) = R(s,a) + gamma*max(Q(s',a))
        targets = rewards+self.discount_factor*max_next_q_values #update the values of the targets based on Q learning update equation

        return targets
        # --------------------------

class ReplayBuffer:
    """This class implements a replay buffer for experience replay. """

    def __init__(self, buffer_size, observation_space, action_space):
      #initialize the replay buffer based on inputs given to DQNAgent
        self.buffer_size = buffer_size #maximum number of experiences the buffer can store, when max is reached the old experience is tossed
        self.observations = np.zeros(
            (buffer_size,) + (2835,), dtype=observation_space['image'].dtype) #size of the environment
        self.next_observations = np.zeros(
            (buffer_size,) + (2835,), dtype=observation_space['image'].dtype
        )
        self.actions = np.zeros(
            (buffer_size,) + action_space.shape, dtype=action_space.dtype
        ) #state space of the agent
        self.rewards = np.zeros((buffer_size,), dtype=np.float32) #rewards earned
        self.terminated = np.zeros((buffer_size,), dtype=np.uint8) #whether the episode has terminated
        self.position = 0 #initialize the position
        self.num_added = 0

    def add(self, observation, action, reward, next_observation, terminated):
        """
        Adds a new experience tuple to the replay buffer.

        Parameters:
            - observation (np.ndarray): The current observation.
            - action (int): The action taken.
            - reward (float): The reward received.
            - next_observation (np.ndarray): The next observation.
            - terminated (bool): Whether the episode terminated after this experience.

        Returns:
            - None
        """
        self.observations[self.position] = observation
        self.next_observations[self.position] = next_observation
        self.actions[self.position] = action
        self.rewards[self.position] = reward
        self.terminated[self.position] = terminated
        self.position = (self.position + 1) % self.buffer_size
        self.num_added += 1

    def sample(self, batch_size):
        """
        Samples a batch of experiences from the replay buffer.

        Parameters:
            - batch_size (int): The number of experiences to sample.

        Returns:
            - observations (np.ndarray): The current observations. Shape (batch_size,
              observation_dim)
            - actions (np.ndarray): The actions taken. Shape (batch_size, action_dim)
            - rewards (np.ndarray): The rewards received. Shape (batch_size,)
            - next_observations (np.ndarray): The next observations. Shape (batch_size,
              observation_dim)
            - terminated (np.ndarray): Whether the episode terminated after this
              experience.
        """
        buffer_size = min(self.num_added, self.buffer_size)
        indices = np.random.randint(0, buffer_size, size=batch_size)
        return (
            self.observations[indices],
            self.actions[indices],
            self.rewards[indices],
            self.next_observations[indices],
            self.terminated[indices],
        )

