def policy_init_network(env: gym.Env) -> nn.Module:
    # Your code here
    # ---------------------------------
    model = nn.Sequential(
    nn.Linear(in_features=env.observation_space.shape[0], out_features=32),
    nn.ReLU(),
    nn.Linear(in_features=32, out_features=32),
    nn.ReLU(),
    nn.Linear(in_features=32, out_features=env.action_space.n),
    nn.Softmax()

    )
    return model
    # ---------------------------------

class Policy:
    def __init__(
        self, env: gym.Env, network: nn.Module, discount=0.99, name="Abstract Policy"
    ):
        self.name = name
        self.network = network
        self.discount = discount

        self.env = env
        self.obs_dim = env.observation_space.shape[0]
        self.n_actions = env.action_space.n
        # Your code here (Part I)
        # ========================
        self.opt = torch.optim.Adam(params=self.network.parameters(), lr=.003)  # lr=pow(10,-3))
        # ========================

    def distribution(self, x: np.ndarray) -> torchdist.distribution.Distribution:
        """
        Get the distribution over actions for a given state. The distribution parameters
        come from the network, which should output the unnormalized probabilities of
        each action. (Note, this is not the same as unnormalized log probabilities).
        """
        dist = None

        # Your code here (Part II)
        # ========================
        state = torch.tensor(x, dtype=torch.float, requires_grad=True)
        probs = self.network(state)
        dist =  torchdist.Categorical(torch.unsqueeze(probs,0))
        # ========================
        return dist

    def action(self, x: np.ndarray) -> int:
        """
        Sample an action from the policy at a given state

        Input: a state encoded as a numpy array
        Output: an action encoded as an int
        """
        action = None
        # Your code here (Part III)
        # ========================
        with torch.no_grad():
          act_dist = self.distribution(x)
          action = act_dist.sample().item()
        # ========================
        return action

    def update(self, states, actions, rewards, dones) -> float:
        raise NotImplementedError

def generate_episode(env: gym.Env, policy: Policy):
    """
    Generates an episode given an environment and policy
    Inputs:
        env - Gymnasium environment
        policy - policy for generating episode
    Returns

    """
    # Initialize lists
    states = []
    actions = []
    rewards = []
    terminated = []
    truncated = []

    # Reset environment
    state, _ = env.reset(seed=0)
    done = False

    # Loop until end of episode
    while not done:
        states.append(state)
        # Get action
        action = policy.action(state)
        actions.append(action)
        # Take step
        state, reward, term, trunc, _ = env.step(action)
        done = term or trunc
        rewards.append(reward)
        terminated.append(term)
        truncated.append(trunc)
    states = np.array(states)
    actions = np.array(actions)
    rewards = np.array(rewards)
    terminated = np.array(terminated)
    truncated = np.array(truncated)
    return (states, actions, rewards, terminated, truncated)

def value_init_network(env: gym.Env) -> nn.Module:
  # Your code here
  # ===========================================================
  return nn.Sequential(
      nn.Linear(env.observation_space.shape[0],32),
      nn.ReLU(),
      nn.Linear(32,32),
      nn.ReLU(),
      nn.Linear(32, 1)
  )
  # ===========================================================

class ActorCriticPolicy(Policy):
    def __init__(
        self,
        env: gym.Env,
        policy_network: nn.Module,
        value_network: nn.Module,
        discount=0.99,
        name="Actor-Critic",
    ):
        super().__init__(env, policy_network, discount=discount, name=name)
        # Your code here
        # Initialize self.value_network and self.value_opt like before
        # ===========================================================
        self.value_network = value_network
        self.value_opt = torch.optim.Adam(params=self.value_network.parameters(),lr=.003) # lr=2*pow(10,-3))
        # ===========================================================

    """
    Run a training episode
    Inputs:
        seed: Seed of the environment (default: 0)
    Returns:
        Dictionary with the following keys:
        - "policy_loss": float of the policy gradient loss (the quantity whose gradient is taken),
                        averaged over the episode
        - "value_loss": float of the squared TD error averaged over the episode
    """

    def train_episode(self, seed=0) -> float:
        loss_dict = {}
        state, _ = self.env.reset(seed=seed)
        # Your code here
        # ======================
        policy_loss = 0
        value_loss = 0
        done = False
        step = 0
        I = 1

        while not done:

          action = self.action(state)
          next_state, reward, term, trunc, _ = self.env.step(action)
          done = term or trunc

          reward = torch.tensor(reward, dtype=torch.float)
          v_current = self.value_network.forward(torch.tensor(state, dtype=torch.float))


          if done:
            delta = reward
          else:
            delta = reward + self.discount * self.value_network.forward(torch.tensor(next_state, dtype=torch.float))

          log_action_proba = self.distribution(state).log_prob(torch.tensor(action, dtype=torch.float))


          actor_loss = - ( delta - v_current) * log_action_proba * I

          critic_loss = 1/2 * F.mse_loss(v_current, delta)

          self.opt.zero_grad()
          actor_loss.backward(retain_graph=True)
          self.opt.step()

          self.value_opt.zero_grad()
          critic_loss.backward()
          self.value_opt.step()

          state = next_state
          policy_loss = policy_loss + actor_loss
          value_loss = value_loss + critic_loss
          step += 1


        policy_loss /= step
        value_loss /= step

        loss_dict['policy_loss'] = policy_loss.item()
        loss_dict['value_loss'] = value_loss.item()
        # ======================
        return loss_dict

